import React from "react";
import css from "@emotion/css";

const LeftInfo = ({ isProfileData }) => {
  const pData = isProfileData && isProfileData.profile;
  console.log(x);

  return (
    <React.Fragment>
      <div className="block">
        <div
          className="text-sm font-sans"
          css={css`
          & > span{
            float:left;
            width:50%:
            display:block;
          }
        `}
        >
          {pData &&
            pData.length > 0 &&
            pData.map((item) => (
              <p>
                <span>Name :</span>
                <span>{item.firstName}</span>
              </p>
            ))}
        </div>
      </div>
    </React.Fragment>
  );
};

export default LeftInfo;
